svg.script:

document.addEventListener('DOMContentLoaded', function() {
  // Network interaction state
  let selectedPrinciple = null;
  let activeFilter = 'high';
  let tracedPathways = new Set();

  // Principle nodes
  const principleNodes = document.querySelectorAll('.principle-node');
  const synergyPaths = document.querySelectorAll('.synergy-path');
  const filterBtns = document.querySelectorAll('.filter-btn');
  const compoundZones = document.querySelectorAll('.compound-zone');

  // Principle selection and pathway tracing
  principleNodes.forEach(node => {
    node.addEventListener('click', function() {
      const principle = this.getAttribute('data-principle');
      selectPrinciple(principle);
      traceOptimalPathways(principle);

      if (typeof window.explorePrincipleNetwork === 'function') {
        window.explorePrincipleNetwork(principle);
      }
    });

    node.addEventListener('keydown', function(e) {
      if (e.key === 'Enter' || e.key === ' ') {
        e.preventDefault();
        this.click();
      }
    });
  });

  // Synergy filtering
  filterBtns.forEach(btn => {
    btn.addEventListener('click', function() {
      const filter = this.getAttribute('data-filter');
      setSynergyFilter(filter);

      filterBtns.forEach(b => b.classList.remove('active'));
      this.classList.add('active');

      if (typeof window.filterSynergyConnections === 'function') {
        window.filterSynergyConnections(filter);
      }
    });
  });

  // Synergy path interaction
  synergyPaths.forEach(path => {
    path.addEventListener('click', function() {
      const connection = this.getAttribute('data-connection');
      showConnectionDetails(connection);

      if (typeof window.analyzeConnection === 'function') {
        window.analyzeConnection(connection);
      }
    });
  });

  // Compound zone exploration
  compoundZones.forEach(zone => {
    zone.addEventListener('click', function() {
      const zoneType = this.getAttribute('data-zone');
      exploreCompoundZone(zoneType);

      if (typeof window.exploreCompoundEffects === 'function') {
        window.exploreCompoundEffects(zoneType);
      }
    });
  });

  // Optimization controls
  const optimizeBtn = document.querySelector('.optimize-btn');
  if (optimizeBtn) {
    optimizeBtn.addEventListener('click', function() {
      generateOptimalSequence();

      if (typeof window.optimizeImplementationSequence === 'function') {
        window.optimizeImplementationSequence();
      }
    });
  }

  // Helper functions
  function selectPrinciple(principle) {
    // Clear previous selections
    principleNodes.forEach(node => {
      node.classList.remove('selected');
    });

    // Highlight selected principle
    const selectedNode = document.querySelector(`[data-principle="${principle}"]`);
    if (selectedNode) {
      selectedNode.classList.add('selected');
      selectedPrinciple = principle;
    }
  }

  function traceOptimalPathways(fromPrinciple) {
    // Reset pathway highlighting
    synergyPaths.forEach(path => {
      path.classList.remove('traced');
    });

    // Highlight pathways from selected principle
    const relevantPaths = document.querySelectorAll(`[data-connection*="${fromPrinciple}"]`);
    relevantPaths.forEach(path => {
      path.classList.add('traced');
      tracedPathways.add(path.getAttribute('data-connection'));
    });

    updatePathwayAnalysis(fromPrinciple);
  }

  function setSynergyFilter(filter) {
    activeFilter = filter;

    // Hide/show synergy connections based on filter
    const allConnections = document.querySelectorAll('.synergy-connections');
    allConnections.forEach(group => {
      const synergy = group.getAttribute('data-synergy');
      if (filter === 'all' || synergy === filter) {
        group.style.opacity = '1';
        group.style.display = 'block';
      } else {
        group.style.opacity = '0.2';
      }
    });
  }

  function showConnectionDetails(connection) {
    if (typeof window.showConnectionDetails === 'function') {
      window.showConnectionDetails(connection);
    } else {
      console.log(`Analyzing connection: ${connection}`);
    }
  }

  function exploreCompoundZone(zoneType) {
    if (typeof window.exploreCompoundZone === 'function') {
      window.exploreCompoundZone(zoneType);
    } else {
      console.log(`Exploring compound zone: ${zoneType}`);
    }
  }

  function generateOptimalSequence() {
    if (typeof window.generateSequence === 'function') {
      window.generateSequence();
    } else {
      console.log('Generating optimal implementation sequence...');
    }
  }

  function updatePathwayAnalysis(principle) {
    // Update pathway analysis panel with selected principle data
    if (typeof window.updatePathwayAnalysis === 'function') {
      window.updatePathwayAnalysis(principle, Array.from(tracedPathways));
    }
  }

  // Real-time network updates
  function updateNetworkMetrics() {
    if (typeof window.updateNetworkMetrics === 'function') {
      window.updateNetworkMetrics();
    }
  }

  // Synergy calculation engine
  function calculateCompoundEffects() {
    if (typeof window.calculateCompoundEffects === 'function') {
      window.calculateCompoundEffects();
    }
  }

  // Initialize network
  if (typeof window.initializeNetwork === 'function') {
    window.initializeNetwork();
  }

  // Periodic updates
  setInterval(updateNetworkMetrics, 30000); // Update metrics every 30 seconds
  setInterval(calculateCompoundEffects, 60000); // Recalculate compound effects every minute
});
